import React from "react";

export function Registro(props) {
  const data = [
    ["Covid 19", "Examen Isopado "],
    ["Antiquenos", "sadad lkjadslkj"],
  ];
  return (
    <div className="container  min-h-screen">
      <button className="m-4 bg-green-primary py-2 px-4 rounded-lg text-white text-lg">
        {" "}
        + Agregar Examen
      </button>

      <table className="bg-white w-11/12 mx-auto mt-6 rounded-t-lg">
        <thead className="bg-blue-primary text-white rounded-t-lg">
          <tr className="text-xl rounded-t-lg">
            <th className="rounded-tl-lg">Nº Cedula</th>
            <th className="border-l border-gray-200">Paciente</th>
            <th className="border-l border-gray-200">Examen</th>
            <th className="border-l border-gray-200">Fecha</th>
            <th className="w-10 border-l border-gray-200"></th>
            <th className="w-10 border-l border-gray-200"></th>
            <th className="w-10 border-l border-blue-900"></th>
            <th className="rounded-tr-lg w-10 border-l border-blue-900'"></th>
          </tr>
        </thead>
        <tbody className="text-center">
          {data.map((element, i) => {
            if (i % 2 === 0) {
              return (
                <tr className="bg-white">
                  <td className="">{element[0]}</td>
                  <td className="border-l border-gray-400">{element[1]}</td>
                  <td className="border-l border-gray-400"></td>
                  <td className="border-l border-gray-400"></td>
                  <td className="border-l border-gray-400"></td>
                  <td className="border-l border-gray-400"></td>
                  <td className="border-l border-gray-400"></td>
                  <td className="border-l border-gray-400"></td>
                </tr>
              );
            }
            return (
              <tr className="bg-gray-200">
                <td className="">{element[0]}</td>
                <td className="border-l border-white">{element[1]}</td>
                <td className="border-l border-white"></td>
                <td className="border-l border-white"></td>
                <td className="border-l border-white"></td>
                <td className="border-l border-white"></td>
                <td className="border-l border-white"></td>
                <td className="border-l border-white"></td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}
